import React from 'react'
import './App.css';

class App extends React.Component {
    render() {

      let isTestCreated = false
      const createTest = () => {
        if(!isTestCreated) {
          isTestCreated = true
          let val = document.getElementById("testName").value;
          document.getElementById("test").innerHTML=+val;
        }
      }

      return (
        <div className="App">
          <h4>Система тестирования</h4>

          <input id="testName" placeholder="Введите название теста"/>
          <button id="testButton" onClick={createTest}>Создать</button>

          <div id="test"></div>
        </div>
      )
    }
}

export default App;
